import React, { useEffect } from "react";

const IntroText = () => {
  return (
    <div>

<p>Hi, I'm <span className="bold">Niels</span>,<br></br> I am Fullstack Software Developer that has just entered the Tech space. Passionate about coding, learning new skills, travelling and riding my bike. Would you like to know more about me? Check out my projects on Github, or reach out on my socials. 
<br></br><br></br>
I am currently updating my portfolio.
</p>


    </div>
  );
};

export default IntroText;
